using System;
using Microsoft.AspNetCore.Hosting;
using Microsoft.Extensions.Hosting;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Configuration;
using Microsoft.Extensions.Logging;
using TransactionHistoryViewer.Data;
using TransactionHistoryViewer.Repositories;
using TransactionHistoryViewer.Services;
using Microsoft.EntityFrameworkCore;

namespace TransactionHistoryViewer
{
    public class Program
    {
        public static void Main(string[] args)
        {
            var host = CreateHostBuilder(args).Build();
            // Ensure database is created and migrated
            using (var scope = host.Services.CreateScope())
            {
                var services = scope.ServiceProvider;
                try
                {
                    var context = services.GetRequiredService<TransactionDbContext>();
                    context.Database.Migrate();
                }
                catch (Exception ex)
                {
                    var logger = services.GetRequiredService<ILogger<Program>>();
                    logger.LogError(ex, "An error occurred during migration");
                    throw;
                }
            }
            host.Run();
        }

        public static IHostBuilder CreateHostBuilder(string[] args) =>
            Host.CreateDefaultBuilder(args)
                .ConfigureWebHostDefaults(webBuilder =>
                {
                    webBuilder.ConfigureServices((context, services) =>
                    {
                        // Configure DbContext with connection string
                        services.AddDbContext<TransactionDbContext>(options =>
                            options.UseSqlServer(context.Configuration.GetConnectionString("DefaultConnection")));

                        // Register repository and service
                        services.AddScoped<ITransactionRepository, TransactionRepository>();
                        services.AddScoped<ITransactionService, TransactionService>();

                        services.AddControllers();
                        services.AddSwaggerGen();
                    });
                    webBuilder.Configure((context, app) =>
                    {
                        var env = context.HostingEnvironment;
                        if (env.IsDevelopment())
                        {
                            app.UseDeveloperExceptionPage();
                        }

                        app.UseSwagger();
                        app.UseSwaggerUI(c => { c.SwaggerEndpoint("/swagger/v1/swagger.json", "TransactionHistoryViewer API V1"); });

                        app.UseRouting();

                        app.UseAuthorization();

                        app.UseEndpoints(endpoints =>
                        {
                            endpoints.MapControllers();
                        });
                    });
                });
    }
}

using System;
using Microsoft.AspNetCore.Mvc;
using RefundProcessingService.Services;
using RefundProcessingService.Domain.Entities;

namespace RefundProcessingService.Controllers
{
    [ApiController]
    [Route("api/[controller]")]
    public class RefundController : ControllerBase
    {
        private readonly IRefundService _refundService;
        public RefundController(IRefundService refundService)
        {
            _refundService = refundService;
        }

        [HttpPost("initiate")]
        public ActionResult<Refund> InitiateRefund([FromBody] Refund refund)
        {
            var result = _refundService.ProcessRefund(refund);
            return Ok(result);
        }

        [HttpGet("{refundId}")]
        public ActionResult<Refund> GetRefundDetails(Guid refundId)
        {
            var refund = _refundService.GetRefund(refundId);
            if (refund == null)
            {
                return NotFound();
            }
            return Ok(refund);
        }
    }
}

