namespace DataCachingService
{
    class Program
    {
        static void Main(string[] args)
        {
            // Initialize the memory cache provider using Microsoft.Extensions.Caching.Memory
            var memoryCache = new MemoryCache(new MemoryCacheOptions());
            ICacheProvider cacheProvider = new MemoryCacheProvider(memoryCache);

            // Alternatively, to use Redis caching, uncomment the following line and provide a valid connection string
            // ICacheProvider cacheProvider = new RedisCacheProvider("your_redis_connection_string");

            // Initialize the cache manager with the chosen cache provider
            CacheManager cacheManager = new CacheManager(cacheProvider);

            // Example usage: Set a cache value with a key and expiration time
            string key = "AccountBalance";
            decimal accountBalance = 10234.56m;
            cacheManager.Set(key, accountBalance, TimeSpan.FromMinutes(10));

            // Retrieve the cached value
            decimal? cachedBalance = cacheManager.Get<decimal>(key);
            Console.WriteLine($"Cached Account Balance: {cachedBalance}");

            // Remove the cache entry
            cacheManager.Remove(key);
        }
    }
}

